tweet:
Last Friday was #NevadaDay observed, but today we celebrate the true anniversary of our Battle Born state!

@SenCortezMasto and I got together to commemorate Nevada Day and answer some state trivia. 

Watch, and let us know how many you answer correctly! https://twitter.com/SenJackyRosen/status/1187761077121146881 …

Thank you for stopping by my office and delivering hundreds of petition signatures from Nevadans.

@SenCortezMasto and I are opposing Lawrence VanDyke’s nomination to serve Nevada on the Ninth Circuit. 

Nevadans deserve a qualified, nonpartisan, fair nominee. https://twitter.com/BattleBornProg/status/1196581815877685248 …

My team was at the inaugural Inspira Awards Ceremony hosted by @LasVegasLBA. 

@UNLVLaw Dean Durand was honored for the work he’s done to help to advance Latino Law Students. 

My sincere congratulations to the ¡Andale! Scholarship recipients. pic.twitter.com/icKwYFDZaM

Every American deserves access to quality, comprehensive health care. 

@ACCinTouch is working to improve cardiovascular care. 

Thanks for stopping by our office, and I look forward to working together to make sure all Americans can get the care they need. pic.twitter.com/pBhBbmmtx1

There is no place for white supremacy at ICE facilities or anywhere in our communities. 

@SenCortezMasto and I are requesting an investigation into reports that a Captain at Pahrump’s detention center posted repeatedly on a white supremacist website.

 https://www.vice.com/en_us/article/7kzv3y/senators-want-to-know-how-a-guy-with-white-nationalist-ties-got-hired-as-a-captain-at-an-ice-facility …

Hazing at our college campuses is never acceptable.

@SenAmyKlobuchar’s bipartisan REACH Act will improve transparency of hazing incidents and direct higher ed institutions to implement comprehensive anti-hazing programs. 

I’m proud to be a co-sponsor. pic.twitter.com/psK02s4Mbc
